CLASS_MAGE = "Les mages sont les utilisateurs emblématiques de la magie en Azeroth, qui apprennent leur art au cours de leurs recherches et études approfondies. Ils portent des armures légères, mais compensent cette faiblesse par une puissante gamme de sorts offensifs et défensifs. Leurs caractéristiques principales sont la puissance des sorts et l'Intelligence.";
CLASS_MAGE_FEMALE = "Les mages sont les utilisateurs emblématiques de la magie en Azeroth, qui apprennent leur art au cours de leurs recherches et études approfondies. Ils portent des armures légères, mais compensent cette faiblesse par une puissante gamme de sorts offensifs et défensifs. Leurs caractéristiques principales sont la puissance des sorts et l'Intelligence.";
CLASS_PALADIN = "Les paladins sont des combattants et défenseurs en armure lourde qui utilisent la magie du Sacré pour soigner les blessures et combattre le mal. Ils sont relativement autonomes et disposent de nombreuses techniques destinées à empêcher les morts. Le paladin peut choisir de se battre avec une arme à deux mains, de protéger avec un bouclier, ou de soigner. Ses caractéristiques principales dépendent du rôle choisi.";
CLASS_PALADIN_FEMALE = "Les paladins sont des combattants et défenseurs en armure lourde qui utilisent la magie du Sacré pour soigner les blessures et combattre le mal. Ils sont relativement autonomes et disposent de nombreuses techniques destinées à empêcher les morts. Le paladin peut choisir de se battre avec une arme à deux mains, de protéger avec un bouclier, ou de soigner. Ses caractéristiques principales dépendent du rôle choisi.";
CLASS_PRIEST = "Les prêtres disposent d'une grande palette d'outils pour soigner, mais ils peuvent également sacrifier leurs soins pour infliger des dégâts grâce à la magie de l'Ombre. En société, les prêtres endossent le rôle de guide spirituel de leurs races respectives. Les caractéristiques principales du prêtre sont la puissance des sorts, l'Intelligence et l'Esprit (s'il s'est spécialisé dans les soins).";
CLASS_PRIEST_FEMALE = "Les prêtres disposent d'une grande palette d'outils pour soigner, mais ils peuvent également sacrifier leurs soins pour infliger des dégâts grâce à la magie de l'Ombre. En société, les prêtres endossent le rôle de guide spirituel de leurs races respectives. Les caractéristiques principales du prêtre sont la puissance des sorts, l'Intelligence et l'Esprit (s'il s'est spécialisé dans les soins).";
CLASS_ROGUE = "Les voleurs endossent souvent le rôle d'assassin ou d'éclaireur, mais nombre d'entre eux sont des loups solitaires. Ils sont doués pour l'ambidextrie avec une large gamme d'armes, la dague étant la plus représentative de cette classe.|n|nLes voleurs peuvent se déplacer furtivement autour de leurs ennemis ou attaquer un adversaire dans le dos pour tenter de l'achever rapidement. Leurs caractéristiques principales sont la puissance d'attaque et l'Agilité.";
CLASS_ROGUE_FEMALE = "Les voleurs endossent souvent le rôle d'assassin ou d'éclaireur, mais nombre d'entre eux sont des loups solitaires. Ils sont doués pour l'ambidextrie avec une large gamme d'armes, la dague étant la plus représentative de cette classe.|n|nLes voleurs peuvent se déplacer furtivement autour de leurs ennemis ou attaquer un adversaire dans le dos pour tenter de l'achever rapidement. Leurs caractéristiques principales sont la puissance d'attaque et l'Agilité.";
CLASS_SHAMAN = "Les chamans invoquent la puissance des éléments pour améliorer les dégâts de leurs armes ou sorts. Ils invoquent des totems en combat pour octroyer des améliorations, soigner ou infliger des dégâts à leurs ennemis. Les chamans ont souvent un rôle de guide spirituel dans les communautés tribales. Leurs caractéristiques principales dépendent de leur rôle.";
CLASS_SHAMAN_FEMALE = "Les chamans invoquent la puissance des éléments pour améliorer les dégâts de leurs armes ou sorts. Ils invoquent des totems en combat pour octroyer des améliorations, soigner ou infliger des dégâts à leurs ennemis. Les chamans ont souvent un rôle de guide spirituel dans les communautés tribales. Leurs caractéristiques principales dépendent de leur rôle.";
CLASS_WARLOCK = "Les démonistes utilisent le Feu et l'Ombre pour infliger des dégâts, drainer ou maudire leurs ennemis. Ils peuvent également drainer les âmes pour alimenter leurs sorts. Ils peuvent convertir leur vie en mana ou invoquer à eux des membres de leur groupe.|n|nSi certaines sociétés de l'Alliance craignent les démonistes, certains peuples de la Horde les considèrent comme de grands chefs. Ce lanceur de sorts favorisera en priorité la puissance des sorts et l'Intelligence.";
CLASS_WARLOCK_FEMALE = "Les démonistes utilisent le Feu et l'Ombre pour infliger des dégâts, drainer ou maudire leurs ennemis. Ils peuvent également drainer les âmes pour alimenter leurs sorts. Ils peuvent convertir leur vie en mana ou invoquer à eux des membres de leur groupe.|n|nSi certaines sociétés de l'Alliance craignent les démonistes, certains peuples de la Horde les considèrent comme de grands chefs. Ce lanceur de sorts favorisera en priorité la puissance des sorts et l'Intelligence.";
CLASS_WARRIOR = "Le guerrier porte une armure en plaques et aspire à la perfection dans les combats. Lorsqu'il inflige ou subit des dégâts, il génère de la rage, utilisée pour alimenter ses attaques spéciales.|n|nCe combattant peut choisir de se spécialiser dans le port d'armes à deux mains, d'armes à une main, ou dans l'utilisation du bouclier en plus d'une arme à une main. Il dispose de plusieurs techniques qui lui permettent de se déplacer rapidement sur le champ de bataille. Sa caractéristique principale est la Force, mais les tanks s'intéresseront également à l'Endurance.";
CLASS_WARRIOR_FEMALE = "Le guerrier porte une armure en plaques et aspire à la perfection dans les combats. Lorsqu'il inflige ou subit des dégâts, il génère de la rage, utilisée pour alimenter ses attaques spéciales.|n|nCe combattant peut choisir de se spécialiser dans le port d'armes à deux mains, d'armes à une main, ou dans l'utilisation du bouclier en plus d'une arme à une main. Il dispose de plusieurs techniques qui lui permettent de se déplacer rapidement sur le champ de bataille. Sa caractéristique principale est la Force, mais les tanks s'intéresseront également à l'Endurance.";
